DROP TABLE IF EXISTS `t_sys_oauth_client_details`;
CREATE TABLE `t_sys_oauth_client_details` (
  `CLIENT_ID` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '应用标识',
  `RESOURCE_IDS` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '资源限定串(逗号分割)',
  `CLIENT_SECRET` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '应用密钥(bcyt) 加密',
  `SCOPE` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '范围',
  `AUTHORIZED_GRANT_TYPES` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '授权方式',
  `WEB_SERVER_REDIRECT_URI` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '回调地址',
  `AUTHORITIES` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '权限',
  `ACCESS_TOKEN_VALIDITY` int DEFAULT NULL COMMENT 'access_token有效期',
  `REFRESH_TOKEN_VALIDITY` int DEFAULT NULL COMMENT 'refresh_token有效期',
  `ADDITIONAL_INFORMATION` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '扩展信息',
  `AUTOAPPROVE` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '是否自动授权',
  `STATUS` varchar(1) DEFAULT NULL COMMENT '是否有效',
  `CREATE_BY` varchar(32) DEFAULT NULL COMMENT '创建人',
  `CREATE_DATE` date DEFAULT NULL COMMENT '创建日期',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_BY` varchar(32) DEFAULT NULL COMMENT '修改人',
  `UPDATE_DATE` date DEFAULT NULL COMMENT '修改日期',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`CLIENT_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='SYS17_应用客户端表';

